import AxiosService from "./AxiosService";

const getByName = (searchText) => {
  // return AxiosService.get(AxiosService.BACKEND_URL + "/stops/" + searchText);
  AxiosService.get(AxiosService.BACKEND_URL + "/stops/" + searchText, {
    headers: { "Access-Control-Allow-Origin": "*" },
    responseType: "json",
  }).then((response) => {
    return response;
  });
};
const getAll = () => {
  //return AxiosService.get(AxiosService.BACKEND_URL + "/stops");

  AxiosService.get(AxiosService.BACKEND_URL + "/stops/", {
    headers: { "Access-Control-Allow-Origin": "*" },
    responseType: "json",
  }).then((response) => {
    return response;
  });
};

const getDepartures = (stopId) => {
  //return AxiosService.get(AxiosService.BACKEND_URL + "/departures/" + stopId);

  AxiosService.get(AxiosService.BACKEND_URL + "/departures/" + stopId, {
    headers: { "Access-Control-Allow-Origin": "*" },
    responseType: "json",
  }).then((response) => {
    return response;
  });
};

export default {
  getAll,
  getByName,
  getDepartures,
};
